import React from "react";
import { useContext } from "react";
import { CartContext } from "./context/CartContext";

const Cart = () => {
    const {cart} = useContext(CartContext);

    return(
        <div className="container">
            <div className="row">
                <div className="col-md-12">
                    {cart.lenght > 0 }
                </div>
            </div>
        </div>
    )
}

export default Cart;
